import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import './home.css';

function Next(){
  console.log("Prev CLICKED");
}

function Prev(){
  console.log("Prev CLICKED");
}

function Home() {
  useEffect(() => {
    document.title = 'Fashion Blog - Home';
  }, []);
  return (
    <div>
      <div className='nav-container'>
        <div className='home-menu'>
          <div className='nav-menu'>
            <ul>
              <li onClick={getPosts}><Link to="/">Home</Link></li>
              <li><Link to="Products">Products</Link></li>
              <li><Link to="Albums">Albums</Link></li>
              <li><Link to="About">About Us</Link></li>
              <li><Link to="Login">Login</Link></li>
            </ul>
          </div>
          <div className='welcome'>
            <h1>Fashion Blog</h1>
          </div>
        </div>
      </div>
      <div className='container'>
        <div className='side-nav'>SIDE NAV HERE
          <div className='side-nav-chi'>
            1
          </div>
        </div>
        <div className='main-page'>
          <div className='prev-btn' onClick={Prev}>
            <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M15 6L9 12L15 18" stroke="black" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            </svg>
          </div>
          <div className='next-btn' onClick={Next}>
            <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M9 6L15 12L9 18" stroke="black" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            </svg>
          </div>
        </div>
      </div>
      <div className='footer'>FOOTER HERE</div>
    </div>
  );
}

const getPosts = () => {
  fetch('http://localhost:82/getPosts', {
    method: 'GET',
    headers: {
      'Content-Type': 'application/json',
    },
  })
    .then((response) => response.text())
    .then((data) => {
      console.log(JSON.stringify(data));
    })
    .catch((error) => console.error('Error:', error));
};

export default Home;
